import * as React from 'react';
import Avatar from '@mui/material/Avatar';
import { Typography } from '@mui/material';
import Box from '@mui/material/Box';

export default function Profile () {
  return (
      <Box sx={{
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        textAlign: 'center',
        bgcolor: 'black',
        borderRadius: 5,
        color: 'white',
        }}>
        <Avatar
          alt="Foto de Perfil do João"
          src="https://avatars.githubusercontent.com/u/81587343?v=4"
          sx={{ marginTop: 3, width: 200, height: 200 }} />
        <Typography component="h1" variant="h5">
            João Victor Martins
        </Typography>
        <Typography sx={{ bgcolor:'#343434', borderRadius:3, padding: '0px 10px 0px 10px',}} component="h1" variant="subtitle1">
          Hi, I'm a <strong>web developer</strong>.
        </Typography>

      </Box>
  );
}
